import React, { Component } from 'react'
import './Home.scss';

export default class Home extends Component {
    render() {
        return (
            <div className="row">
                <div className="col">
                    <div className="BackgroundDiv justify-content-center">
                        <h1>Hello</h1>
                    </div>
                </div>
            </div>
        )
    }
}
